import React, {Component} from 'react';
import brandimg from "../../brand/brand/express_bengal_meat.png";
import  './shopbycategory.css'

class ShopByCategory extends Component {
    render() {
        return (

            <div className="shopbycategory">

                <div className="shopbycategory-top">

                    <div className="heading">
                        <h2>{this.props.headingName}</h2>


                        <div className="search">

                            <input type="text" placeholder="Search......"/>
                            <div className="searchbutton">
                                <button><i style={{color:"#ffffff"}} className="fas fa-search"></i></button>
                            </div>
                        </div>


                    </div>


                </div>


                <div className="shopbycategory-bottom">
                    <div className="item1">
                        <img src={brandimg} alt=""/>
                        <p className="name">Sohrab</p>
                        <p className="price">805</p>

                    </div>
                </div>
            </div>
        );
    }
}

export default ShopByCategory;
